// Import
import React from "react";
import "./css/evaluationAssess.css";
import GeneralButton from "../general/GeneralButton";



// Assessment component
const EvaluationAssessment = ({style, setStyle, dataToAssess}) => {

    const styleButton = {height:'3rem'};

    console.log("data: ", dataToAssess);

    return (
        <div style={style} id="divEvaluationAssess">
            <div id="divEvaluationAssessMain">
                <div id="divEvaluationAssessTitle">
                    <h2>Company assessment</h2>
                </div>

                <div id="divEvaluationAssessLabels">
                    <label>
                        <span>Company name: &nbsp; &nbsp;</span>
                        {dataToAssess.company.name}
                    </label>

                    <label>
                        <span>Evaluation creator: &nbsp; &nbsp;</span>
                        {dataToAssess.user.email} - {dataToAssess.user.full_name}
                    </label>
                </div>

                <div id="divEvaluationAssessRadios">
                    <label htmlFor="inputZero">0</label>
                    <input type="radio" name="evaAssess" className="evaAssess" id="inputZero" />

                    <label htmlFor="inputZero">1</label>
                    <input type="radio" name="evaAssess" className="evaAssess" id="inputOne" />

                    <label htmlFor="inputZero">2</label>
                    <input type="radio" name="evaAssess" className="evaAssess" id="inputTwo" />

                    <label htmlFor="inputZero">3</label>
                    <input type="radio" name="evaAssess" className="evaAssess" id="inputThree" />

                    <label htmlFor="inputZero">4</label>
                    <input type="radio" name="evaAssess" className="evaAssess" id="inputFour" />

                    <label htmlFor="inputZero">5</label>
                    <input type="radio" name="evaAssess" className="evaAssess" id="inputFive" />
                </div>

                <div id="divEvaluationAssessButtons">
                    <GeneralButton 
                        children={'Close'}
                        onClick={() => setStyle({visibility:'hidden', opacity:'0'})}
                        style={styleButton}
                    />

                    <GeneralButton
                        children={'Save'}
                        style={styleButton}
                    />
                </div>                
            </div>            
        </div>
    )
};



// Export
export default EvaluationAssessment;
